import React from "react";
import "./css/style.css";

class ContactPage extends React.Component {
  constructor(props) {
    super(props);
  }

  render() {
    return (
      <div>
        <h1> This is the Contact Page</h1>
      </div>
    );
  }
} //END OF CLASS

export default ContactPage;
